ere plaats. Ten minste', 'https://static.openfoodfacts.org/images/products/366/207/201/6333/front_fr.4.400.jpg', '6.69', '4.37', '8.3', '6.01', '1.79', '73.6', '2.16', '0.850393700787402', '', '0');

